import React from 'react'
import ReactDOM from 'react-dom';
import StoreFrames from './StoreFrames.js'
import './Store.css'
import StoreCategories from './StoreCategories';
import HiveComponents from './HiveComponents'

const items = (i) => {
    if(i === 'StoreFrames')
    {
        return <StoreFrames/>
    }
    else if(i === 'HiveComponents')
    {
        return <HiveComponents/>
    }
}

function Store( { items } ) {
    return (
        <div className='store'>
            <div className='store__left'>
                <StoreCategories/>
            </div>
            <div className='store__right'>
               {items ? StoreFrames : <StoreFrames/>}
               {items ? HiveComponents : <HiveComponents/>}
               {/* <StoreFrames/> */}
            </div>
        </div>
        
    )
}

export default Store;
